/**
 * Restores redisjson with necessary info
 * @param {*} req 
 * @param {*} res 
 * @returns status response
 */
export async function restoreData(req, res) {
    try {
        let homePageVideos = await UserHomePageVideosRepository.search()
            .where("isDeleted")
            .is.not.equal(true)
            .returnAll();

        _.each(homePageVideos, async (videoData) => {
            await UserHomePageVideosRepository.remove(videoData?.entityId);
        });

        await UserHomePageVideosRepository.createAndSave(videoData);

        return res.json({
            Success: true,
            message: "Home page videos data restored",
            code: 200,
        });
    } catch (error) {
        return res.json({
            Success: false,
            message: "Unexpected server error",
            error,
            code: 500,
        });
    }
}
